import React from 'react'
import styled from 'styled-components'
const Body = styled.body`
    text-align:center;
`
const H1 = styled.h1`
    /* */
`

const Image = styled.body`
    display:inline;
`

export default class Content extends React.Component{
    render(){
        return(
            <Body>
                <img src="/static/images/pic1.jpg" alt="king" />
                <img src="/static/images/queenandking.jpg" alt="king" />
                <img src="/static/images/kingandboat.jpg" alt="king" />
                <img src="/static/images/kingandpipe.jpg" alt="king" />
                <img src="/static/images/kingandfufu.jpg" alt="king" />
                <img src="/static/images/kingandoldkinggun.jpg" alt="king" />
                <img src="/static/images/kingandgun.jpg" alt="king" />
                <img src="/static/images/kingandfathergun.jpg" alt="king" />
            </Body>
        )
    }
}
